        </Classe>
    );
}
const Classe = styled.div`
    position: relative;
    div{
        display: flex;
        width: 70px;
        height: 70px;
        border-radius: 50%;
        background-color: #FF6E4E;



    }
    ion-icon {
        font-size: 45px;

        color: #FFFFFF;
        position: absolute;
        z-index: 1;
        top: 0px

    }
`;
